import React from 'react'

const BookmarkScreen = ({route}) => {
  // const check =  route.params.mark
  const [check1,setCheck1] = useState('hello');
  var check = check1;
  if(check === 'hello'){
  return (
    <View>
      <Button
                title='             Rollover             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  navigation.navigate('rollover')   
                }}
                />
    </View>
  )}else {
    return (
      <View>
        <Text>BookmarkScreennnn</Text>
        <Text>BookmarkScreen</Text>
        <Text>hello : {check}</Text>
      </View>
    )
  }
}

export default BookmarkScreen

